/** Imports */
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';
import Footer from './Componentes/Footer';
import Main from './Componentes/Main';
import Header from './Componentes/Header';
import MainEuropa from './Componentes/MainEuropa';
import MainCanada from './Componentes/MainCanada';
import MainEstadosUnidos from './Componentes/MainEstadosUnidos';
import MainSudamerica from './Componentes/MainSudamerica';
import MainMexico from './Componentes/MainMexico';
import MainCentroAmerica from './Componentes/MainCentroAmerica';
import MainPacifico from './Componentes/MainPacifico';
import MainMedioOriente from './Componentes/MainMedioOriente';
import MainAsia from './Componentes/MainAsia';
import MainAfrica from './Componentes/MainAfrica';
import MainEventos from './Componentes/MainEventos';
import MainCruceros from './Componentes/MainCruceros';
import MainJuvi from './Componentes/MainJuvi';
import Ofertas from './Componentes/Ofertas';
import Promociones from './Componentes/Promociones';
import MainExoticos from './Componentes/MainExoticos';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  useParams
} from "react-router-dom";


function Detail() {
  const { detail, name }  = useParams()
  return (
      <>  
      <div className="main">
      {/**  <section className="main__header fresa">
        <h1 className="main__h1"><span className="main__span back__fresa">{name}</span>
                    <div className="maple"><img className="maple-img" src="https://exodus.b-cdn.net/exodus/frutas/fresa/img/maple.png" alt=""/></div>
            </h1>
            <div className="woman">
                <img src="https://exodus.b-cdn.net/exodus/frutas/fresa/img/chica-fresa.png" alt="" className="woman__img" />
            </div>
        </section>*/} 
                                <section>
    <h1 className="main__span back__fresa">
                   {name}
                  {/* <div className="maple"><img className="maple-img" src="https://exodus.b-cdn.net/exodus/frutas/fresa/img/maple.png" alt=""/></div>*/} 
            </h1>
    </section>
    <section className="section-top-ten">
        <div className="container">
            <div className="row">
                <div className="col-md-12">
          <iframe className="iframe-detail" title="detail" src={'https://www.megatravel.com.mx/tools/circuito.php?&txtColor=e60a33&aColor=e60a33&ahColor=e46879&thBG=e46879&thTxColor=fff&ff=7&viaje='+detail} width="100%" height="1200"  allowtransparency="true"> </iframe>
          </div> 
            </div> 
        </div>   
        </section> 
        </div>     
      </>
  )
}


function App() {

  /** Conexion API */

  const [datos, setUser] = useState([]);

  useEffect(() => {
  axios.get('https://2020.exodus.mx/api/agency/53').then(res => {
  const datos = res.data;

  setUser(datos);    
  });
  }, [])

  /** Devuelve Template */
  return (
    <Router >
    <div className="App">

        <Switch>

        <Route path="/detail/:detail/:name">
              <Header 
                  user={datos}
              />
              <Detail />
              <Footer 
                user={datos} 
              />
        </Route>

        <Route path="/ofertas">
          <Header 
            user={datos}
          />

          <Ofertas />
          <Footer 
            user={datos} 
          />
        </Route>

          <Route path="/europa">
          <Header 
            user={datos}
          />
          <MainEuropa user={datos} />
          <Footer 
            user={datos} 
          />
          </Route>
          <Route path="/canada">
          <Header 
            user={datos}
          />
          <MainCanada />
          <Footer 
            user={datos} 
          />
          </Route>
          <Route path="/estados-unidos">
          <Header 
            user={datos}
          />
          <MainEstadosUnidos />
          <Footer 
            user={datos} 
          />
          </Route>
          <Route path="/mexico">
          <Header 
            user={datos}
          />
          <MainMexico />
          <Footer 
            user={datos} 
          />
          </Route>
          <Route path="/sudamerica">
          <Header 
            user={datos}
          />
          <MainSudamerica />
          <Footer 
            user={datos} 
          />
          </Route>
